    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-dea50b",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113884 includes chemical,
    discrete sample, physical and profile data collected from AKADEMIK FYODOROV in the
    East Siberia Sea and Laptev (or Nordenskjold) Sea from 1994-07-05 to 1994-08-08
    and retrieved during cruise CARINA/90AQ19940706. These data include ALKALINITY,
    DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, Potential temperature
    (theta), SALINITY, SILICATE, Total Organic Carbon (TOC) and WATER TEMPERATURE. The
    instruments used to collect these data include CTD and bottle. These data were collected
    by Leif Anderson of Gothenburg University; Department of Analytical and Marine Chemistry
    as part of the CARINA/90AQ19940706 data set.nnThe CARINA (CARbon dioxide IN the
    Atlantic Ocean) data synthesis project is an international collaborative effort
    of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
    consistent data set of open ocean subsurface measurements for biogeochemical investigations,
    in particular, studies involving the carbon system. The original focus area was
    the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
